import React from 'react'
import Questions from "./Questions";

const FAQ = () => {
    return (
        <>
            <div className='bg-black h-96'>

                <h1 className='text-center text-white text-5xl font-bold py-10' > Frequently Asked Questions</h1>

                <div>

                    {
                        Questions.map(({ id, que }) => {
                            return <>
                                <div className='flex justify-around'>
                                    <div className='flex justify-between bg-gray-600 w-1/2  mx-10  '>
                                        <div className='text-white ' key={id}>{que}</div>
                                    </div>
                                </div>
                            </>
                        })
                    }

                </div>

            </div>
        </>
    )
}

export default FAQ
